import {combineReducers} from 'redux';
import getItems from './getItemsReducer';
import addTemplates from './addTemplates';
import isActivefirst from './isActive';

const rootReducer = combineReducers({
    getItems,
    addTemplates,
    isActive,
});

export default rootReducer;
